    false,nt"url": null,nt"notes": "This funding is necessary to operate a
    four-person invasive species strike team to treat invasive trees on the Wallula
    Unit of McNary NWR. Over a one month period the crew will cut and stump treat 100%
    of tree of heaven (Ailanthis altissima) and Russian olive (Elaeagnus angustifolia)
    on the 2,300 acre unit.The objective is to remove all immature and seed producing
    trees on the management unit. Tree ofheaven has been newly identified as having
    a presence in the Wallula Unit as of 2014. This management action will seek to remove
    this tree species from the unit before it can establish a further foothold. Russian
    olive has a more long-standing and widely distributed presence on the unit, but
    remains at levels that we believe to be controllable.",nt"license_title": "License
